import{_ as e,o as r,c as a,O as t}from"./chunks/framework.9482e208.js";const p=JSON.parse('{"title":"§ 19.2-386.18 Forfeiture of unlawful electronic communication devices.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/19.2-386.18.md","filePath":"vacode/19.2-386.18.md"}'),o={name:"vacode/19.2-386.18.md"},i=t('<h1 id="§-19-2-386-18-forfeiture-of-unlawful-electronic-communication-devices" tabindex="-1">§ 19.2-386.18 Forfeiture of unlawful electronic communication devices. <a class="header-anchor" href="#§-19-2-386-18-forfeiture-of-unlawful-electronic-communication-devices" aria-label="Permalink to &quot;§ 19.2-386.18 Forfeiture of unlawful electronic communication devices.&quot;">​</a></h1><p>Any unlawful electronic communication device possessed, manufactured or sold in violation of §§ <a href="http://law.lis.virginia.gov/vacode/18.2-190.2/" target="_blank" rel="noreferrer">18.2-190.2</a>, <a href="http://law.lis.virginia.gov/vacode/18.2-190.3/" target="_blank" rel="noreferrer">18.2-190.3</a> or § <a href="http://law.lis.virginia.gov/vacode/18.2-190.4/" target="_blank" rel="noreferrer">18.2-190.4</a> may be seized and forfeited to the Commonwealth, and turned over to the circuit court in the city or county in which it was seized and such property shall be disposed of as provided by law.</p><p>2002, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?021+ful+CHAP0671" target="_blank" rel="noreferrer">671</a>, § 18.2-190.7; 2003, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?031+ful+CHAP0354" target="_blank" rel="noreferrer">354</a>; 2004, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?041+ful+CHAP0995" target="_blank" rel="noreferrer">995</a>.</p>',3),n=[i];function c(l,f,s,d,u,_){return r(),a("div",null,n)}const v=e(o,[["render",c]]);export{p as __pageData,v as default};
